import math

def solve(ln, m):
    return math.log(m, ln)

def solve(x):
    ln = 0
    m = 0
    while x > 1:
        ln += 1
        x /= 2
    while x < 0.5:
        ln -= 1
        x *= 2
    while m < x:
        m += 1
    return ln, m

def solve(n):
    result = 0
    for i in range(1, n + 1):
        result += math.log(i)
    return result

